Johannes, Dei gratia Francorum rex. Notum facimus universis, tam presentibus quam futuris, quod provi nobis humiliter fuit expositum ex parte amicorum carnalium Hugonis Guiberti, filii Thome Guiberti, quod cum guerris durantibus ecclesia de Bellou in Pictavia per gentes nostras in dictis partibus exisentes, quodem modo fuisset debilitata ne forsita inomici eandem fortificarent. nichilominus Anglici et alii inimici regni nostri de die in diem predictum locum accupare volebant, prout vot et fama laborabant, quod attendenter parrochi dicte ecclesie et alii circonitivi timentes ne forsitam dictusque Hugo ad requestem plurium parrochianorum predictorum, una cum eisdem dictam ecclesiam fortificaverunt causa sue tuicionis, et eandem contra dictos inimicos ben deffenderunt et pro eo pluria victualia et alia bona mobilia in et super paria acceperunt, cumque carissimus primogenitus noster, dux Norman, dum nobis absentibus regnum nostrum regebat pace refor mata inter nos et carissimum fratrem nostrum regem Anglie fecerit generalem abolucionem criminum guerris durantibus commissorum prosecucione civili partibus reservata, dictusque Hugo ad instigacionem suorum emulorum, occasione premissorum posset forsi tam in futurum accusari vel vexari, et propter hoc nobis humiliter supplicarant, ut cum ipse Hugo hactenus fuerit bone fame velimus eidem super hoc nostre misericordie gremium apparire. nos, attentis et consideratis premissis predicto Hugoni facta supradicta ac cetera omnia alia que sub dicta generali abolucione possunt et debent comprehandi, civili prosecucione dutapat partibus reserva ta atque omnem penam corporalem, criminalem et ciivilem, quas erga nos, occasione premissorum potuerit quomodolibet incur risse, remittimus, quittamus ac tenore presentium penitus in dulgemus in casu premisso, ipsumque restituimus ad famam patriam et bona. Dantes, tenore presentium in mandatis senescall Pictavensis ceterisque justiciariis, officiaris nostris aut eorum loca tenentibus, presentibus pariter et futurus, quatinus dictum Hugonem, nostra presenti gracia uti et gaudere pacifice faciant et permittant ipsum in contrarium nullatenus molestantis aut molestari quomodolibet permittentes, sed si quis de bonis suis propter hoc captum seu saisitum extitit eidem volumus restitui indilate, quicquid secus factum vel attemptatum fuerit ad statum pristinum et debitum celerire. Quod ut firmum et stabile permaneat in futurum, presentes litteras sigilli nostri mi miine facimus roborari. Salvo in aliis jure nostro et in omnibus quolibet alieno. Actum et Datum Parisius, anno Domini m coclx, mense iuiii. Per regem, ad relationem consilii in quo vos eratis. ferricus.


